Injected navigation prop were incorrectly typed to provide only non-leaf route state props. Added tests for both kinds of injected route state. Backwards compatible, no breaking changes

The component screen props were correctly typed to accept a leaf or a top level route as state...
```
interface NavigationScreenProps<
  Params = NavigationParams,
  Options = any
  > {
  navigation: NavigationScreenProp<NavigationRoute<Params>, Params>;
  //...
}
```
Where...
```
interface NavigationScreenProp<S, P = NavigationParams> {
  state: S & { params?: P };
  //...
}

type NavigationRoute<Params = NavigationParams> =
  | NavigationLeafRoute<Params>
  | NavigationStateRoute<Params>;

interface NavigationLeafRoute<Params = NavigationParams> {
  key: string;
  index: number;
  routeName: string;
  path?: string;
  params?: Params;
}

type NavigationStateRoute<
  NavigationLeafRouteParams
  > = NavigationLeafRoute<NavigationLeafRouteParams> & NavigationState;
```

But the injected navigation props that provides this was typed as just `NavigationState` (a subset of the `NavigationRoute` discrimated union), so made it less accessible than it needs to be...
```
interface NavigationInjectedProps<P = NavigationParams> {
  navigation: NavigationScreenProp<NavigationState, P>;
}
```

Image below is the injected navigation state for a leaf route in debugger, which being typed as `NavigationState` was not able to access properties without local type hacks. 
