Hey @apapirovski, @jrakotoharisoa, @Kallikrein, @pdeva, @mDibyo, @NicholasBoll, @tansongyang, @clayne11, @kenzierocks, @tkqubo thanks for the existing definitions, I would l ike to contribute with this PR.

It adresses a problem I have quite often when using [redux-thunk](https://github.com/reduxjs/redux-thunk) action creators which look like this:

```ts
function doSomethingAsync() {
    return dispatch => {
       return Promise.resolve('foo').then((result) => {
           dispatch({
               type: 'WHATEVER',
               payload: {
                   result
               }
           })
       })
    };
}
```
the middleware will provide the action creator with the dispatch function and the action creator will return the value from the inner function (the Promise in this example). Unfortunately this can not be known by the `connect` function and therefore one can't do something like this:
```tsx
componentDidMount() {
    this.props.doSomethingAsync().then(...)
}
```
because the return type of doSomethingAsync is inferred to be the function which takes the `dispatch` as an argument.

In this PR, I made use of a conditional type so that we're sure to only 'fix' the thunk actions and leave all other actions as they are.
I'm aware that these are the typings for react-redux and that not everyone uses redux-thunk but it's definitely a well known part of the redux ecosystem and therefore I would love to have support for it.
